# Function to activate conda environment
activate_conda_env <- function(conda_env_name) {
  # Determine the operating system
  os <- Sys.info()["sysname"]
  
  # Construct the command to activate the conda environment
  conda_activate_cmd <- paste("conda activate", conda_env_name)
  
  # Execute the command based on the operating system
  if (os == "Windows") {
    system2("cmd.exe", args = c("/c", conda_activate_cmd), "&&", "cd", conda_env_name, stdout = TRUE, stderr = TRUE)
  } else {
    system2("bash", args = c("-c", conda_activate_cmd), "&&", "cd", conda_env_name, stdout = TRUE, stderr = TRUE)
  }
}

# Function to convert Windows path to WSL path
convert_windows_path_to_wsl <- function(windows_path) {
  sub("^////wsl.localhost//Ubuntu", "", gsub("\\\\", "/", windows_path))
}

# Function to convert paths for macOS/Linux if needed
convert_path <- function(path) {
  if (Sys.info()["sysname"] == "Windows") {
    convert_windows_path_to_wsl(path)
  } else {
    path
  }
}
