server <- function(input, output, session) {
  
  # Helper function to construct the command with conda activation
  # Helper function to convert paths
  convert_path <- function(path) {
    normalizePath(path, mustWork = FALSE)
  }
  
  convert_path_hmmer <- function(path) {
    if (Sys.info()["sysname"] == "Windows") {
      path <- gsub("\\\\", "/", path)
      path <- sub("^//wsl\\.localhost/Ubuntu", "", path)
      path <- sub("^//wsl\\$/Ubuntu", "", path)
      if (grepl("^[A-Za-z]:", path)) {
        path <- sub("^([A-Za-z]):", "/mnt/\\L\\1", path)
      }
      return(path)
    } else {
      return(path)
    }
  }
  
  convert_path_hmmer2 <- function(path) {
    if (Sys.info()["sysname"] == "Windows") {
      gsub("^([A-Za-z]):", "/mnt/\\L\\1", gsub("\\\\", "/", path), perl = TRUE)
    } else {
      path
    }
  }
  
  convert_path_ <- function(path) {
    if (Sys.info()["sysname"] == "Windows") {
      gsub("^([A-Za-z]):", " ", gsub("\\\\", "/", path), perl = TRUE)
    } else {
      path
    }
  }
  
  convert_path_hmmer3 <- function(path) {
    if (Sys.info()["sysname"] == "Windows") {
      # Replace backslashes with forward slashes
      path <- gsub("\\\\", "/", path)
      # Remove the prefix added by WSL for accessing Windows files
      path <- sub("^//wsl\\.localhost/Ubuntu", "", path)
      # Convert Windows drive letter to WSL mount point
      
      if (grepl("^[A-Za-z]:", path)) {
        path <- sub("^([A-Za-z]):", "/mnt/\\L\\1", path, perl = TRUE)
      }
      return(path)
    } else {
      return(path)
    }
  }
  # Flag to check if environment is activated
  env_activated <- reactiveVal(FALSE)
  
  observeEvent(input$install_deepsece, {
    # Check if user typed any environment name
    if (nzchar(input$conda_env_deepsece)) {
      # They did, so show a CONFIRMATION modal
      showModal(modalDialog(
        title = "Confirm Conda environment setup",
        paste0(
          "You entered the environment: '", input$conda_env_deepsece, 
          "'. Please ensure it is pre-set with Python 3.9.7 (or higher). ",
          "Continue with the DeepSecE installation?"
        ),
        footer = tagList(
          modalButton("Cancel"),
          actionButton("confirm_install_deepsece", "Yes, install DeepSecE")
        ),
        easyClose = TRUE
      ))
    } else {
      # If user did NOT type an environment name, show an ERROR modal
      showModal(modalDialog(
        title = "No Conda environment provided!",
        "Please enter the name of your Conda environment before installing DeepSecE.",
        easyClose = TRUE,
        footer = modalButton("OK")
      ))
    }
  })
  
  # When user confirms from the modal, run the actual installation script
  observeEvent(input$confirm_install_deepsece, {
    removeModal()  # close the confirmation modal
    
    shinyjs::show("loading_install_spinner")  # show the spinner
    
    # Create a temporary shell script file
    temp_script <- tempfile(fileext = ".sh")
    
    # Write the installation script to the file
    writeLines(c(
      "#!/bin/bash",
      "set -e",  # Exit immediately on error
      
      # Dynamically find Conda and source it
      "CONDA_PATH=$(command -v conda || true)",
      "if [ -z \"$CONDA_PATH\" ]; then",
      "    echo '❌ Conda not found in PATH! Trying common locations...';",
      "    if [ -f \"$HOME/anaconda3/etc/profile.d/conda.sh\" ]; then",
      "        . \"$HOME/anaconda3/etc/profile.d/conda.sh\";",
      "    elif [ -f \"$HOME/miniconda3/etc/profile.d/conda.sh\" ]; then",
      "        . \"$HOME/miniconda3/etc/profile.d/conda.sh\";",
      "    elif [ -f \"/opt/anaconda3/etc/profile.d/conda.sh\" ]; then",
      "        . \"/opt/anaconda3/etc/profile.d/conda.sh\";",
      "    elif [ -f \"/usr/local/anaconda3/etc/profile.d/conda.sh\" ]; then",
      "        . \"/usr/local/anaconda3/etc/profile.d/conda.sh\";",
      "    else",
      "        echo '❌ Conda installation not found. Please install Conda and try again.';",
      "        exit 1;",
      "    fi",
      "fi",
      
      # Activate Conda environment
      paste("conda init && conda activate ", shQuote(input$conda_env_deepsece)),
      
      # Install DeepSecE and dependencies
      "pip install git+https://github.com/zhangyumeng1sjtu/DeepSecE.git",
      "pip install macsyfinder",
      "conda install -y -c bioconda hmmer",
      
      # Download DeepSecE profiles
      "mkdir -p data && cd data",
