  adjust_path <- function(path) {
    # Only adjust the path on Windows
    if (Sys.info()[["sysname"]] == "Windows") {
      
      # Common WSL root paths to try
      wsl_roots <- c("//wsl.localhost/Ubuntu-24.04", "//wsl.localhost/Ubuntu")
      
      # Check each root to see if the path is valid under that root
      for (root in wsl_roots) {
        # Build candidate path
        candidate_path <- paste0(root, path)
        
        # If it's a valid file or directory in WSL, return it
        if (file.exists(candidate_path) || dir.exists(candidate_path)) {
          return(candidate_path)
        }
      }
      
      # If neither path exists, fall back to the original path
      # (and optionally emit a warning or message)
      warning("Could not find a valid WSL path. Using the original path.")
    }
    
    # If not Windows, or if no valid WSL path is found, return the original path
    return(path)
  }
  
  
