      "    elif [ -f \"/usr/local/anaconda3/etc/profile.d/conda.sh\" ]; then",
      "        . \"/usr/local/anaconda3/etc/profile.d/conda.sh\";",
      "    else",
      "        echo '❌ Conda installation not found. Please install Conda and try again.';",
      "        exit 1;",
      "    fi",
      "fi",
      
      # Activate the Conda environment
      paste("conda activate", shQuote(input$conda_env_cblaster)),
      
      # Install cblaster using pip
      "pip3 install cblaster --user"
    )
    
    # Construct the lines for Windows (.bat) script
    # You will likely need to adjust how Windows finds conda, e.g., using 'where conda'.
    windows_lines <- c(
      "@echo off",
      "REM Exit immediately on error",
      "setlocal EnableDelayedExpansion",
      
      ":: Try to locate conda in PATH using 'where conda'",
      "where conda >nul 2>nul",
      "IF %ERRORLEVEL% NEQ 0 (",
      "    echo ❌ Conda not found in PATH! Trying common locations...",
      "    :: If you have known common paths, you could set them here, e.g.:",
      "    :: call %USERPROFILE%\\anaconda3\\Scripts\\activate.bat",
