      "pip3 install cblaster --user"
    )
    
    # Write the appropriate script depending on the OS
    if (os_name == "Windows") {
      writeLines(windows_lines, temp_script)
    } else {
      writeLines(unix_lines, temp_script)
      # Make the .sh file executable
      Sys.chmod(temp_script, mode = "0755")
    }
    
    # Now, run the script
    result <- tryCatch({
