  # 1) Create a reactiveVal to store the background session's working directory
  #    so that other observeEvents can access it later.
  background_wd <- reactiveVal(NULL)
  
  observeEvent(input$run3, {
    req(input$fastaFile3)
    
    shinyjs::show("loading-run3")
    
    # Normalize the path to the user-uploaded FASTA file
    fasta_file_clean <- normalizePath(input$fastaFile3$datapath, winslash = "/")
    
    # 2) Decide the working directory for the background process:
    #    Here, we simply set it to the user's HOME directory (as an example).
    #    Store it in the reactiveVal for later use.
    background_wd(Sys.getenv("HOME"))
    
    # Temporary files to capture stdout and stderr
    stdout_file <- tempfile()
    stderr_file <- tempfile()
    
    # 3) Run your script in the background with callr::r_bg
    bg_process <- callr::r_bg(
      func = function(fasta_file_clean) {
        # This code runs *inside* the background R session
        library(reticulate)
        use_condaenv("base", required = TRUE)
        
        # Give time so we can see partial output
        Sys.sleep(5)
        
        file_conda <- gsub("\\\\", "/", fasta_file_clean)
        file_conda1 <- "/home/bioinfo/bua.fasta"  # example override?
        
        script_contents <- paste(
          "conda activate base && biolib run DTU/DeepTMHMM --fasta", 
          shQuote(file_conda),  # or shQuote(file_conda)
          sep = " "
        )
        
        if (Sys.info()["sysname"] == "Windows") {
          # Run in cmd.exe for Windows
          system2("cmd.exe", args = c("/c", script_contents),
                  stdout = TRUE, stderr = TRUE)
          cat("Executed script - \n", script_contents)
        } else {
          # Run in bash for Unix/Linux
          system2("bash", args = c("-c", script_contents),
                  stdout = TRUE, stderr = TRUE)
          cat("Executed script - \n", script_contents)
        }
      },
      args = list(fasta_file_clean = fasta_file_clean),
      
      # IMPORTANT: Use the directory stored in background_wd() for the BG process
      wd = background_wd(),
      
      stdout = stdout_file,
      stderr = stderr_file,
      env = c(PATH = Sys.getenv("PATH"))
    )
    
    # 4) Observe and capture output while the process is alive
    observe({
      invalidateLater(1000, session)  # poll every 1 second
      
      if (bg_process$is_alive()) {
        stdout <- tryCatch(readLines(stdout_file, warn = FALSE), error = function(e) NULL)
        stderr <- tryCatch(readLines(stderr_file, warn = FALSE), error = function(e) NULL)
        
        output$consoleOutputDeep <- renderText(
          paste(c(stdout, stderr), collapse = "\n")
        )
      } else {
        # Process finished
        if (bg_process$get_exit_status() == 0) {
          stdout <- tryCatch(readLines(stdout_file, warn = FALSE), error = function(e) NULL)
          output$consoleOutputDeep <- renderText(
            paste("Command executed successfully:\n", paste(stdout, collapse = "\n"))
          )
        } else {
          stderr <- tryCatch(readLines(stderr_file, warn = FALSE), error = function(e) NULL)
          output$consoleOutputDeep <- renderText(
            paste("Command failed with error:\n", paste(stderr, collapse = "\n"))
          )
        }
        shinyjs::hide("loading-run3")
        return(NULL)  # Stop this observer once done
      }
    })
  })
  
  
  # 5) Update read_results_file() to take a base_dir argument
  read_results_file <- function(base_dir, subfolder, filename) {
    results_path <- file.path(base_dir, subfolder, filename)
    results_path <- normalizePath(results_path, mustWork = FALSE)
    
    if (file.exists(results_path)) {
      file_text <- readLines(results_path)
      return(c(file_text, paste("Results saved to:", results_path)))
    } else {
      return(paste(filename, "file not found in", results_path))
    }
    
  }
  
  
