  convert_path_hmmer <- function(path) {
    if (Sys.info()["sysname"] == "Windows") {
      path <- gsub("\\\\", "/", path)
      path <- sub("^//wsl\\.localhost/Ubuntu", "", path)
      if (grepl("^[A-Za-z]:", path)) {
        path <- sub("^([A-Za-z]):", "/mnt/\\L\\1", path)
      }
      return(path)
    } else {
      return(path)
    }
  }
  
  
  observeEvent(input$setdir_conda, {
    
    activate_conda_env <- function(conda_env_hmmbuild) {
      
      # Normalize the path to a Unix-style path if it is a Windows path
      conda_env_hmmbuild <- gsub("\\\\", "/", conda_env_hmmbuild)
      
      # Extract the Conda environment path (up to and including the environment name)
      conda_env_path <- sub("^(.*/envs/[^/]+)(/.*)?$", "\\1", conda_env_hmmbuild)
      
      # Convert the Conda environment path to WSL format if necessary
      conda_env_path_wsl <- convert_path_hmmer(conda_env_path)
      
      # Convert the full path to WSL format if necessary
      full_path_wsl <- convert_path_hmmer(conda_env_hmmbuild)
      
      message <- paste("Conda directory set to", full_path_wsl)
      
      return(message)
    }
    
    conda_message <- activate_conda_env(input$conda_env_hmmbuild)
    output$conda_message <- renderText({ conda_message })
    
