      wsl_output_file_hmmbuild_hmmer <- convert_path_hmmer2(output_file_hmmbuild_hmmer)
      
      
      # Create the temporary script file within the WSL environment
      script_file <- system2("wsl", c("mktemp", "/tmp/hmmbuild_script.XXXXXX.sh"), stdout = TRUE)
      script_file <- trimws(script_file)
      
      # Script contents
      script_contents <- paste(
        "source $HOME/anaconda3/etc/profile.d/conda.sh",  # Source conda.sh to initialize conda
        "&& conda activate", input$conda_env_hmmbuild, 
