      print(paste("Script Contents:\n", script_contents))
      print(paste("WSL Script Path:", script_file))
      
      # Execute the script within WSL
      result <- tryCatch({
        os_info <- Sys.info()["sysname"]
        if (os_info == "Windows") {
          # Write the script contents to the file using WSL
          system2("wsl", c("bash", "-c", shQuote(paste("echo", shQuote(script_contents), ">", script_file))))
          
