    hide("loading-hmmbuild-dir")
    
    # Display the result of the command
    output$setdiroutput_hmmbuild <- renderText({
      paste("Result of setting conda environment:", 
            conda_result_hmmbuild$output, 
            if (conda_result_hmmbuild$status == 0) paste("Success, conda environment set to", convert_path_hmmer(conda_env_hmmbuild)) else "Failed")
    })
  })
  
  
  
  convert_path_hmmer2 <- function(path) {
    if (Sys.info()["sysname"] == "Windows") {
      gsub("^([A-Za-z]):", "/mnt/\\L\\1", gsub("\\\\", "/", path), perl = TRUE)
    } else {
      path
    }
  }
  
  
  
