    wsl_temp_file_hmmbuild_hmmer <- convert_path_hmmer2(file.path(workdir_hmmbuild, temp_file_hmmbuild_hmmer))
    wsl_output_file_hmmbuild_hmmer <- convert_path_hmmer2(output_file_hmmbuild_hmmer)
    wsl_hmm_file_hmmbuild_hmmer <- convert_path_hmmer2(file.path(workdir_hmmbuild, hmm_file_hmmbuild_hmmer))
    
    # Ensure the output directory exists in WSL
    output_dir <- dirname(wsl_output_file_hmmbuild_hmmer)
