      sep = " "
    )
    
    # Determine the operating system
    os_info <- Sys.info()["sysname"]
    
    # Debug: Print the constructed command
    print(paste("Full Command:", command_full_hmmbuild_hmmer))
    
    # Execute the appropriate command based on the operating system
    command_result_hmmbuild_hmmer <- tryCatch({
      if (os_info == "Windows") {
        # If on Windows, execute the command using WSL
        result <- system2("wsl", c("bash", "-c", command_full_hmmbuild_hmmer), stdout = TRUE, stderr = TRUE)
      } else {
        # If on Linux/Mac, execute the command directly
        result <- system2("bash", c("-c", command_full_hmmbuild_hmmer), stdout = TRUE, stderr = TRUE)
      }
      result
    }, error = function(e) {
      return(paste("Error:", e$message))
    })
    
    # Hide loading spinner
