  observeEvent(input$setdir_conda_search, {
    
    activate_conda_env <- function(conda_env_hmmsearch) {
      
      # Normalize the path to a Unix-style path if it is a Windows path
      conda_env_hmmsearch <- gsub("\\\\", "/", conda_env_hmmsearch)
      
      # Extract the Conda environment path (up to and including the environment name)
      conda_env_path_search <- sub("^(.*/envs/[^/]+)(/.*)?$", "\\1", conda_env_hmmsearch)
      
      # Convert the Conda environment path to WSL format if necessary
      conda_env_path_wsl_search <- convert_path_hmmer(conda_env_path_search)
      
      # Convert the full path to WSL format if necessary
      full_path_wsl <- convert_path_hmmer(conda_env_hmmsearch)
      
      message <- paste("Conda directory set to", full_path_wsl)
      
      return(message)
    }
    
    conda_message_search <- activate_conda_env(input$conda_env_hmmsearch)
    output$conda_message_search <- renderText({ conda_message_search })
    
