  observeEvent(input$conda_dir_hmmsearch, {
    conda_env_hmmsearch <- input$conda_env_hmmsearch
    
    show("loading-hmmsearch-dir")
    
    # Function to activate conda environment
    activate_conda_env_wsl <- function(conda_env_hmmsearch) {
      
      # Normalize the path to a Unix-style path if it is a Windows path
      conda_env_hmmsearch <- gsub("\\\\", "/", conda_env_hmmsearch)
      
      # Extract the Conda environment path (up to and including the environment name)
      conda_env_path <- sub("^(.*/envs/[^/]+)(/.*)?$", "\\1", conda_env_hmmsearch)
      
      # Convert the Conda environment path to WSL format if necessary
      conda_env_path_wsl <- convert_path_hmmer(conda_env_path)
      
      # Convert the full path to WSL format if necessary
      full_path_wsl <- convert_path_hmmer(input$workdir_hmmsearch)
      
      hmm_file_hmmsearch_hmmer <- input$hmmfile_hmmsearch$name
      path <- sub("^//wsl.localhost/Ubuntu", "", conda_env_hmmsearch)
      wsl_hmm_file_hmmbuild_hmmer <- convert_path_hmmer2(file.path(path, hmm_file_hmmsearch_hmmer))
      
      file_conda <- input$seqfile_hmmsearch$name
      output_search <- input$searchfile_hmmsearch
      
      # Create the temporary script file within the WSL environment
      script_file <- system2("wsl", c("mktemp", "/tmp/hmmbuild_script.XXXXXX.sh"), stdout = TRUE)
      script_file <- trimws(script_file)
      
      # Script contents
      script_contents <- paste(
        "source $HOME/anaconda3/etc/profile.d/conda.sh",  # Source conda.sh to initialize conda
        "&& conda activate", shQuote(conda_env_path_wsl), 
        "&& cd", shQuote(full_path_wsl),
        "&& hmmsearch", shQuote(hmm_file_hmmsearch_hmmer), shQuote(file_conda), ">", shQuote(output_search),
        "2>&1",  # Redirect stderr to stdout
        sep = " "
      )
      
      # Debug: Print the script contents
      cat("Script contents:\n", script_contents, "\n")
      
      result <- tryCatch({
        os_info <- Sys.info()["sysname"]
        if (os_info == "Windows") {
          # Write the script contents to the file using WSL
          system2("wsl", c("bash", "-c", shQuote(paste("echo", shQuote(script_contents), ">", shQuote(script_file)))), stdout = TRUE, stderr = TRUE)
          
          # Execute the script within WSL
          output <- system2("wsl", c("bash", shQuote(script_file)), stdout = TRUE, stderr = TRUE)
        } else {
          # Write the script contents to the file on Linux
          write_script(script_contents, script_file)
          
          # Execute the script directly on Linux
          output <- system2("bash", shQuote(script_file), stdout = TRUE, stderr = TRUE)
        }
        list(output = output, status = 0)
      }, error = function(e) {
        list(output = e$message, status = 1)
      })
      
      return(result)
    }
    
    # Call the function and capture the result
    conda_result_hmmsearch <- activate_conda_env_wsl(conda_env_hmmsearch)
    
    # Display the result of the command
    output$setdiroutput_conda_hmmsearch <- renderText({
      paste(conda_result_hmmsearch$output, 
            if (conda_result_hmmsearch$status == 0) paste("Success, conda environment set to", convert_path_hmmer(conda_env_hmmsearch)) else "Failed")
    })
    
    
    
    hide("loading-hmmsearch-dir")
    
    output_file_hmmsearch_hmmer <- file.path(input$workdir_hmmsearch, input$searchfile_hmmsearch)
    wsl_output_file_hmmsearch_hmmer <- convert_path_hmmer2(output_file_hmmsearch_hmmer)
    
    output_file_path(wsl_output_file_hmmsearch_hmmer)
    
    # Update the UI with the command result
    output$debug_hmmsearch_conda <- renderText({
      paste("Command output:\n", paste(conda_result_hmmsearch$output, collapse = "\n"))
    })
    
  })
  
  
  
